import React from "react";
import Head from "next/head";
import PaginationStyles from "./styles/PaginationStyles";

function Pagination({ page }) {
	return (
		<PaginationStyles>
			<Head>
				<title>Sick Fits - Page {page} of ___</title>
			</Head>
		</PaginationStyles>
	);
}

export default Pagination;
